import React, { useEffect, useState } from "react";
import DeleteButton from "./DeleteButton";
import "./cart.css"
import UpdateButton from "./UpdateButton";


function Cart() {


  //   if (!isLoggedIn) return <Redirect to="/Login" />;
function FetchData(){
  const [Photos, setDisplay]= useState([]);


  useEffect(()=>{
   fetch('http://localhost:3000/Photos')
   .then(res=>res.json())
   .then(data=>
    setDisplay(data))
  },[])


  function handleLike(e){
    let curValue=parseInt(e.target.textContent)
            curValue+=1
            e.target.textContent=curValue;
            console.log(curValue)

            // fetch(`http://localhost:3000/Photos`, {
            //   method: 'POST',
            //   headers: { 'Content-Type': 'application/json' },
            //   body: JSON.stringify(curValue)
            // })
            // .then((r)=>r.json())
            // .then(user=>console.log(user))
  }

  function handleBid(e){
    let curValue=parseInt(e.target.textContent)
    curValue+=250
    e.target.textContent=curValue;
    console.log(curValue)
  }

  return (
    <div className="display1">
       <UpdateButton on />
      {Photos.map(photo =>(
        <div className="content" key={photo.id}>
          <img src={photo.cover} alt={photo.id}></img>
          <h1>{photo.title}</h1>
          <p>Price:{photo.price}</p>
          <button id="like" onClick={handleLike}>{photo.like}  <svg class="empty" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" width="32" height="32"><path fill="none" d="M0 0H24V24H0z"></path><path d="M16.5 3C19.538 3 22 5.5 22 9c0 7-7.5 11-10 12.5C9.5 20 2 16 2 9c0-3.5 2.5-6 5.5-6C9.36 3 11 4 12 5c1-1 2.64-2 4.5-2zm-3.566 15.604c.881-.556 1.676-1.109 2.42-1.701C18.335 14.533 20 11.943 20 9c0-2.36-1.537-4-3.5-4-1.076 0-2.24.57-3.086 1.414L12 7.828l-1.414-1.414C9.74 5.57 8.576 5 7.5 5 5.56 5 4 6.656 4 9c0 2.944 1.666 5.533 4.645 7.903.745.592 1.54 1.145 2.421 1.7.299.189.595.37.934.572.339-.202.635-.383.934-.571z"></path></svg>
  <svg class="filled" height="32" width="32" viewBox="0 0 24 24" xmlns="http://www.w3.org/2000/svg"><path d="M0 0H24V24H0z" fill="none"></path><path d="M16.5 3C19.538 3 22 5.5 22 9c0 7-7.5 11-10 12.5C9.5 20 2 16 2 9c0-3.5 2.5-6 5.5-6C9.36 3 11 4 12 5c1-1 2.64-2 4.5-2z"></path></svg></button>
          <button id="upload" onClick={handleBid}>{photo.upload}<p>BID</p></button>   
        </div>
      ))}
      <DeleteButton />

    </div>
  );

}









//return for App
return (
  <div className="App" class="display">





{/* intro qip */}
<div class="vibes">
  <h1>Vibes</h1>
  <p>Its all about the vibes broski, dont take it eezy take it hard papi <br></br>
      Se trata de las vibraciones broski, no lo tomes eezy tómalo duro papi</p>
 </div>

   <FetchData />

  </div>
);

}

export default Cart;
